export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},X4EuCDWOQP:{data:{id:376,attributes:{imdbId:"tt0041196",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZGI5ZmU3NjctOTNiMS00YjE5LTg3YTEtZWVjZDVhOTEwZTljXkEyXkFqcGdeQXVyMjgyNjA0NjM@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"}],item_lang:{data:{id:1039,attributes:{title:"Bomba: The Jungle Boy",plot:"George Harland and his daughter Patricia are in the African jungle to photograph animals. They discover something altogether different when they find a young white boy living there. When Patricia is separated from her father, she is rescued by Bomba. who it turns out, has been living there since the age of 2. They have a number of adventures together with Patricia trying to explain to Bomba about the outside world which is something he has difficulty imagining. They come to the rescue of her father and the rest when they are attacked by unfriendly tribesmen.",slug:"bomba-the-jungle-boy"}}},books:{data:[{id:3319,attributes:{title:e,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=arApzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2021-04-01",publisher:a,subtitle:a}},{id:3320,attributes:{title:e,description:"Separated from his parents since childhood, a young boy, who has been brought up in the jungle by an old naturalist, begins the long search for his true identity.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RfEZEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2021-02-01",publisher:"eBookIt.com",subtitle:a}},{id:3321,attributes:{title:"Bomba, the Jungle Boy and the Moving Mountain",description:"Separated from his parents since childhood, Bomba lived far back in the jungles of the Amazon with a half-demented naturalist who told the lad nothing of his past. The jungle boy was a lover of birds, and hunted animals with a bow and arrow and his trusty machete. He had a primitive education in some things, and his daring adventures will be followed with breathless interest by thousands. „Bomba the Jungle Boy” is a series of American boy’s adventure books produced by the Stratemeyer Syndicate under the pseudonym Roy Rockwood. There are 20 books in the series. The first ten are set in South America, where Bomba, who grew up in the jungle, tries to discover his origin. The second set of ten books shift the scene to Africa, where a slightly older Bomba has jungle adventures. A highly entertaining literature being written for young readers in post-dime-novel America.",thumbnail:a,authors:[b],firstBook:d,published:"2018-01-01",publisher:a,subtitle:a}},{id:3322,attributes:{title:"Bomba, the Jungle Boy in the Swamp of Death",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KxdMAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1953-01-01",publisher:a,subtitle:a}},{id:3323,attributes:{title:e,description:a,thumbnail:a,authors:[b],firstBook:d,published:"1000-01-01",publisher:a,subtitle:"The Moving Mountain"}}]}}},meta:{}}},prerenderedAt:1682568383448}}("","Roy Rockwood","movie",null,"Bomba the Jungle Boy","series",1))